import React, { useState, useEffect } from "react";

const Test = () => {
	const [count, setCount] = useState(0);

	const doSomething = () => {
		console.log(count);
	};

	const incrementCount = () => {
		setCount(count + 1);
	};

	useEffect(() => {
		doSomething();
	});

	return <button onClick={incrementCount}>123</button>;
};

export default Test;
